export const IndexAppBarStyle = {
    root: {
        flexGrow: 1,
    },
    grow: {
        flexGrow: 1,
        textAlign:'left'
    },
    menuButton: {
        marginLeft: -12,
        marginRight: 20,
    },
    ListMenu:{
        marginLeft:10,
    },
    ListItem:{
        '& span': {
            textAlign: 'center',
            color: '#fff'
        }
    }
};
